import React from 'react';
  
const Settings = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>About This Page</h1>
    </div>
  );
};
  
export default Settings;
